
public class 반복문_for {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		  for(int i=1;i<=10;i++) {
	          
	    	   System.out.print(i+" ");
	       }
	        int i=1;
	       while (i<=10) 
	       {
	    	   System.out.print(i+" ");
	    	   i++;
	    	  
	       }
	}  

}
